import { GridList } from "@material-ui/core";
import { Component } from "react";
import { Item } from "../../components/cart-item/item.css"
import Order from '../order/Order';

class UserInProgress extends Component {

    state = {
        orders: [
            {
                productId: 0,
                userId: 0,
                quantity: 0
            }
        ]
    }

    render() {
        return (
            <div className="grid-container">
                <GridList cols={3} cellHeight={250} style={{ height: 'auto' }} >
                    {
                        this.state.orders.map(order =>
                            <ul key={order.id}>
                                <Item key={order.id} productData={order} onClickBuy={this.props.onClickBuy} />
                            </ul>
                        )
                    }
                </GridList>
            </div>
        );
    }
}

export default UserInProgress;
